  false,\n\t\"url\": null,\n\t\"notes\": \"TASK NAME: Southeast Michigan LiDAR LiDAR
  Data Acquisition and Processing Production Task- Monroe, St. Clair, Macomb, and
  Livingston Counties SEMCOG CONTRACT: 2009-009 Woolpert ORDER NUMBER: 70398 CONTRACTOR:
  Woolpert, Inc. LiDAR data is a remotely sensed high resolution elevation data collected
  by an airborne platform. The LiDAR sensor uses a combination of laser range finding,
  GPS positioning, and inertial measurement technologies.The LiDAR systems collect
  data point clouds that are used to produce highly detailed Digital Elevation Models
  (DEMs) of the earth's terrain, man-made structures, and vegetation. This data was
  collected at a resolution of one and one half point point per square meter. The
  final products include first, last, and at least one intermediate return LAS, a
  bare earth model, and intensity data in separate files.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
